//}

//const greeting = React.createElement('h1', null, 'Bienvenido a Tornado E-Commerce');

function App() {
  return (
    <>
    <Router>
      <NavBar/>
      <Switch>
        <Route exact path='/' component={ItemListContainer}/>
        <Route exact path='/categoria/:slug' component={ItemListContainer}/>
        <Route exact path='/detalle' component={ItemDetailContainer}/>
      </Switch>
    </Router>
    </>
  );
}

export default App;
